        public static Byte[] iDecryptData(Byte[] lpBuffer, UInt64 dwNameHash, Int32 dwSize)
        {
            UInt32 dwHash = CRC32.iGetHash(BitConverter.GetBytes(dwNameHash), 8);
            dwHash ^= 0x8088405;

            UInt32 dwKey = CRC32.iGetHash(BitConverter.GetBytes(dwSize), 4, dwHash);

            Int32 i = 0;
            Int32 dwRemained = dwSize & 3;
            Int32 dwBlocks = dwSize >> 2;
            Int32 dwIndex = dwBlocks;

            Int32 dwOffset = 0;
            for (i = 0; i < dwBlocks; i++)
            {
                UInt32 dwData = BitConverter.ToUInt32(lpBuffer, dwOffset);
                dwKey = m_Table[(dwKey + --dwIndex) & 0xFFF] + 0x2E6D23C1;
                dwData ^= dwKey;

                lpBuffer[dwOffset + 0] = (Byte)dwData;
                lpBuffer[dwOffset + 1] = (Byte)(dwData >> 8);
                lpBuffer[dwOffset + 2] = (Byte)(dwData >> 16);
                lpBuffer[dwOffset + 3] = (Byte)(dwData >> 24);
                dwOffset += 4;
            }

            dwIndex = dwRemained & 0xFFF;
            if (dwRemained > 0)
            {
                UInt32 dwCurrentKey = m_Table[dwIndex] ^ dwKey;
                for (Int32 j = 0; j < dwRemained; j++)
                {
                    lpBuffer[i * 4 + j] ^= (Byte)(dwCurrentKey);
                    dwCurrentKey >>= 8;
                }
            }

            dwKey = 31 * dwKey + 0x8088405;

            return lpBuffer;
        }
    }
